How exciting! DreamWorks now has its own channel which has just launched in Australia on @foxtel channel 717! We love getting cosy and settling in for some quality family time.. especially on these cold winter days. 
Some of our favourites TV series include Trolls: The Beat Goes On! and The Boss Baby: Back in Business (the kids like to think Cosmo is Boss Baby 😆), Dragons: Riders of Berk, and so much more. You can watch the DreamWorks channel now showing on @foxtel channel 717!

